--
-- Name: cmdsitelocationdeployment; Type: VIEW; Schema: public; Owner: csiro
--

CREATE VIEW cmdsitelocationdeployment AS
 SELECT cmddeploymentdetails.cmdddid,
    cmddeploymentdetails.cmddd_slid,
    cmddeploymentdetails.cmddd_cbid,
    cmddeploymentdetails.cmdddname,
    cmddeploymentdetails.cmddddeploymentdate,
    cmddeploymentdetails.cmdddrecoverydate,
    cmddeploymentdetails.cmddddateinposition,
    cmddeploymentdetails.cmddddateoutposition,
    cmddeploymentdetails.cmdddlatitude,
    cmddeploymentdetails.cmdddlongitude,
    cmddeploymentdetails.cmddddepth,
    cmddeploymentdetails.cmdddstatus,
    cmddeploymentdetails.cmdddupdatedby,
    cmddeploymentdetails.cmdreadonly,
    cmdsitelocation.cmdslid,
    cmdsitelocation.cmdsl_fsid,
    cmdsitelocation.cmdslname,
    cmdsitelocation.cmdsldepth,
    cmdsitelocation.cmdslnominallatitude,
    cmdsitelocation.cmdslnominallongitude,
    cmdsitelocation.cmdsldescription,
    cmdsitelocation.cmdslfacility,
    cmdsitelocation.cmdslpi,
    cmdfieldsite.cmdfsid,
    cmdfieldsite.cmdfs_cbid,
    cmdfieldsite.cmdfsshortname,
    cmdfieldsite.cmdfslongname,
    cmdfieldsite.cmdfsdescription,
    cmdfieldsite.cmdfsnominaltimezone,
    cmdfieldsite.cmdfsinstitution
   FROM ((cmddeploymentdetails
     JOIN cmdsitelocation ON ((cmddeploymentdetails.cmddd_slid = cmdsitelocation.cmdslid)))
     JOIN cmdfieldsite ON ((cmdsitelocation.cmdsl_fsid = cmdfieldsite.cmdfsid)));


ALTER TABLE public.cmdsitelocationdeployment OWNER TO csiro;

